import React from 'react'

function User(props) {
    console.log(props.friends);
    return (
        <div>User
            <div>İsim: {props.name}</div>
            <div>Şehir: {props.city}</div>
            <div>Plaka Şehir: {props.plate}</div>
            <hr />
            {
                props.friends.map((friend, i) => (<div key={i}> {friend}</div>))
            }
            <hr />
        </div>
    )
}

export default User
